It was a twitter challenge to write a game under 140 characters.  

And this is my attempt.  The game here is to hit the key as soon as the dot starts moving. You have to keep the key pressed in order to gain the points.  The trick here is maintain your distance near the dot under 3px  --&gt;  { (you - comp) < 3 }

In the console you can see your score :)

